//Project Pages Frame --- --- --- --- ---

//Intro Scene ---------

.Projects-Intro-Wrap {
    width: 100%;
    height: 100vh;
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    z-index: 10001;
}   

    .Projects-Intro-Inner {
        width: 100%;
        height: 100%;
        position: relative;
    }

        .Project-Intro-Slide {
            width: 100%;
            height: 100%;
            position: absolute;
            top: -100%;
            left: 0;
            right: 0;
            transition: all;
        }

            .Projects-Intro-Logo {
                width: 80px;
            }

            .Project-Intro-Slide1 {
                background-color: rgb(240, 240, 240);
            }
            .Project-Intro-Slide2 {
                background-color: #141414;
                display: flex;
                justify-content: center;
                align-items: center;
            }






//Intro Section --------- -------- ------ ---- -- -
.ProjectIntro {
    width: 100%;
    height: 100vh;
    position: relative;
}

    .ProjectIntro-BG {
        width: 100%;
        height: 100%;
        position: absolute;
        opacity: .6;
    }

    .ProjectIntro-Scroll {
        position: absolute;
        font-size: 10px;
