            margin: 0 auto;
            position: relative;
            padding-left: 10%;
        }

            .ProjectIntro-Title {
                font-size: 100px;
                font-family: aktiv-grotesk-condensed, sans-serif;
                font-weight: 900;
                font-style: normal;
                text-transform: uppercase;
            }

            .ProjectIntro-Info {
                width: 100%;
            }

            .ProjectIntro-Links {
                width: 350px;
                padding-left: 10px;
                display: flex;
                justify-content: space-between;
            }

                .ProjectIntro-LinkWrap {
                    width: 100%;
                    margin-bottom: 10px;
                }
                    .GitHubLink {
                    }

                    .WebsiteLink {
                    }

                    .ProjectIntro-Link {
                        font-size: 16px;
                        font-weight: 600;
                        text-transform: uppercase;
                        white-space: nowrap;
                    }
                        .ProjectIntro-Link:hover {
                           color: rgba(240, 240, 240, 0.5)
                        }



                .ProjectIntro-Descriptions {
                    padding-left: 10px;
                    margin-bottom: 80px;
                }

                .ProjectIntro-Type {
                    font-size: 12px;
                    text-transform: uppercase;
                    margin-bottom: 10px;
                    white-space: nowrap;
                }

                .ProjectIntro-Date {
                    font-size: 12px;
                    text-transform: uppercase;
                    white-space: nowrap;
                }


@media screen and (max-height: 700px){
    .ProjectIntro-Descriptions {
        margin-bottom: 40px;
    }
}

@media screen and (max-width: 900px){
    .ProjectIntro-BG {
        background-position: right;
    }
}
@media screen and (max-width: 740px){
    .ProjectIntro-Title {
        font-size: 80px;
    }

}

@media screen and (max-width: 570px){
    .ProjectIntro-Title {
        font-size: 50px;
