    }

}


//SPWA Text Section ----------- ------------ --------- 
.ProjectSPWA {
    width: 100%;
    padding: 100px 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #FFF;
    color: #141414;
}

    .ProjectSPWA-Content {
